    return (
      <div className="home-container">
         <h1 className="home-h1">You got the travel plans, we got the travel cars.</h1>
         <p className="home-paragraph">Add adventure to yur life by joining the #carlife movement. Rent the perfect car to make your perfect road trip.</p>
      </div>
    );
};
